import React, { Component } from 'react'
import AwesomeButton from 'react-awesome-button'

export default class ReactButton extends Component {
    render() {
        return (
            <div>
                <AwesomeButton
                type="primary"
                href="https://google.com"
                >
                    OpenSea
                </AwesomeButton>
            </div>
        )
    }
}
